import React from 'react';
import {parseJsonByString} from "../../../common/utils";
import {Banner,Footer,Study} from "../../components";

const pageSchema = parseJsonByString(window.localStorage.schema,{});
const children = pageSchema.children || [];
const render = (item,index) => {
    switch (item.name) {
        case 'Banner':
            return <Banner key={index}/>
        case 'Footer':
            return <Footer key={index} />
        case 'List':
            return <Study key={index}/>
        default:
            return null;
    }
}

export const HomePage = () => {
    return (
        <div>
            {children.map((item,index)=> render(index,item))}
        </div>
    );
}
